# Function definitions\n\ndef initLookups():\n    global lookup\n    lookup = {}\n    lookup["A"] = "AA"\n    lookup["B"] = "BB"\n    # Add more key-value pairs as needed\n    # ...\n\n\ndef getlookup(key):\n    return lookup.get(key, "")\n\n# Initialization code\nif __name__ == "__main__":\n    initLookups()  # Initialize the lookup dictionary\n    key = "A"  # Example key\n    print(getlookup(key))  # Example usage